 "When building an MCQ consider the following: <ul>\n<li> Use phrases that learners are familiar with and have \nencountered in their study <\/li>\n<li> Keep responses concise <\/li>\n<li> There should be some consistency between the stem and the responses <\/li>\n<li> Provide enough options to challenge learners to think about their response\n<\/li>\n<li> Try to make sure that correct responses are not more detailed than the \ndistractors <\/li>\n<li> Distractors should be incorrect but plausible <\/li>\n<\/ul>\n": "Cando constr\u00faa un test de Preguntas de resposta m\u00faltiple considerere o seguinte: <ul>\n<li> Use frases coas que os alumnos estean familiarizados e \nte\u00f1an visto no seu estudo <\/li>\n<li>Mante\u00f1a as respostas nunha forma concisa <\/li>\n<li> Deber\u00eda haber unha certa consustencia entre a ra\u00edz das preguntas e as respostas <\/li>\n<li> Proporcione as opci\u00f3ns suficientes para desafiar os alumnos a que pensen as respostas\n<\/li>\n<li> Intente asegurarse de que as respostas correctas  non son m\u00e1is detalladas do que \nos distraidores <\/li>\n<li> Os distraidores deber\u00edan ser incorrectos mais plaus\u00edbeis <\/li>\n<\/ul>\n", 
